import "../style/home-about.css";

const HomeAbout = () => {
  return (
    <div>
      <img
        className="about-container"
        src="https://aish.s3.eu-west-2.amazonaws.com/public/files/uploads/61cdcb99fb1d7bb789f825d791245efdbd52a299.jpg"
      />
      <div></div>
    </div>
  );
};

export default HomeAbout;
